	function jsonp(url, success)
		{
		var ud = '_' + Math.floor(Math.random()*1000000)+ '_' +(new Date().getTime()),
			script = document.createElement('script'),
			head = document.getElementsByTagName('head')[0]
				|| document.documentElement;

		window[ud] = function(data)
			{
			head.removeChild(script);
			success && success(data);
			};

		script.src = url.replace('callback=?', 'callback=' + ud);
		head.appendChild(script);
		}

	function createCookie(name, value, days, domain)
		{
		var expires = "";
		if (days)
			{
			var date = new Date();
			date.setTime(date.getTime() + (days * 24 * 60 * 60 * 1000));
			expires = "; expires=" + date.toUTCString();
			}
		// document.cookie = name + "=" + value + expires + "; path=/; domain=" + domain;
		jsonp( aoServerContext + "/beacon/cookie.jsp?name="+encodeURIComponent(name)+"&value="+encodeURIComponent(value)+"&callback=?" );
		}

	function clearCookie(name, domain)
		{
		// document.cookie = name + "=; expires="+(new Date(0).toUTCString())+"; path=/; domain=" + domain;
		jsonp( aoServerContext + "/beacon/cookie.jsp?name="+encodeURIComponent(name)+"&clear=1&callback=?" );
		}

	function readCookie(name)
		{
		var nameEQ = name + "=";
		var ca = document.cookie.split(';');
		for (var i = 0; i < ca.length; i++)
			{
			var c = ca[i];
			while (c.charAt(0) == ' ') c = c.substring(1, c.length);
			if (c.indexOf(nameEQ) == 0) return c.substring(nameEQ.length, c.length);
			}
		return null;
		}

	function getSeenDomains()
		{
		var seen = readCookie('sfgaseen'+aoAccountId);
		return seen != null ? seen.split('_') : [];
		}

	function setSeenDomains( domains )
		{
		createCookie('sfgaseen'+aoAccountId,domains.join('_'),aoCookieTimeout,aoCookieDomain);
		}

	function getQueryString( url )
		{
		if ( !url ) return "";
		var index = url.indexOf( '?' );
		return index < 0 ? "" : url.substr( index + 1 );
		}

	function getParamNames( qs )
		{
		var names = [], pairs = qs.split('&');
		for ( var i = 0; i < pairs.length; i++ )
			{
			var pair = pairs[i];
			var index = pair.indexOf( '=' );
			names.push( index < 0 ? pair : pair.substr( 0, index ) );
			}
		return names;
		}

	function trim( str )
		{
		return str.replace(/^\s+|\s+$/g,'');
		}

	function contains( arr, value )
		{
		for ( var i = 0; i < arr.length; i++ )
				if ( arr[i] == value )
						return true;
		return false;
		}

	function getMainDomain ( url )
		{
		if ( url == null)
			return null;

		url = trim( url.toLowerCase() );

		var index = url.indexOf ("://");
		if (index != -1)
			url = url.substr( index + 3 );
		index = url.indexOf ("/");
		if (index != -1)
			url = url.substr(0, index);

		var parts = url.split(".");
		var n = parts.length;

		if (n == 1)
			return parts[0];
		else if (parts[n - 1].length== 2 && "co" == parts[n - 2])
			return parts[n - 3] + "." + parts[n - 2] + "." + parts[n - 1];
		else
			return parts[n - 2] + "." + parts[n - 1];
		}

	function getParameter(queryString, parameterName)
		{
		if (queryString.length == 0)
			return null;

		var begin = queryString.indexOf (parameterName+"=");

		if (begin == -1)
			return null;

		begin += parameterName.length+1;

		var end = queryString.indexOf ("&", begin);
		if (end == -1)
			end = queryString.length;

		return decodeURIComponent(queryString.substring (begin, end));
		}

	if ( aoCookieMode == 'STANDARD' || optInExists )
		{
		var referrer = ''+document.referrer;
		var loc = ''+document.location;
		var seen = getSeenDomains();
		var rDomain = getMainDomain( referrer );
		var lDomain = getMainDomain( loc );
		var lastSource = readCookie('sfgasrc'+aoAccountId);
		var source = "";
		if ( !rDomain || !lastSource || (rDomain && rDomain != lDomain && !contains(seen,rDomain)) )
			{
			var time = new Date();
			var detail = "Time: " + time.toUTCString() + "\n";
			var search = null;
			var utm_source = null;
			var utm_medium = null;
			var utm_term = null;
			var utm_content = null;
			var utm_campaign = null;
			if ( rDomain )
				{
				var rQS = getQueryString( referrer );
				var lQS = getQueryString( loc );
				var lPNames = getParamNames( lQS );
				utm_source = getParameter(lQS,'utm_source');
				utm_medium = getParameter(lQS,'utm_medium');
				utm_term = getParameter(lQS,'utm_term');
				utm_content = getParameter(lQS,'utm_content');
				utm_campaign = getParameter(lQS,'utm_campaign');
				detail += "&ref="+encodeURIComponent(referrer);
				if ( rDomain.length > 6 && rDomain.substr(0,6) == 'google' )
					{
					search = getParameter( rQS, "q" );
					source = contains( lPNames, 'gclid' ) ? "Google AdWords" : "Organic - Google";
					}
				else if ( rDomain.length > 5 && rDomain.substr(0,5) == 'yahoo' )
					{
					search = getParameter( rQS, "p" );
					source = "Organic - Yahoo";
					}
				else if ( rDomain.length > 4 && rDomain.substr(0,4) == 'bing' )
					{
					search = getParameter( rQS, "q" );
					source = "Organic - Bing";
					}
				else if ( rDomain != lDomain && !contains(seen,rDomain) )
					{
					source = "Web Referral";
					}
				else
					{
					source = "Web Direct";
					}
				}
			else
				{
				source = "Web Direct";
				}
			detail += "Lead Source: "+source+"\n";
			if ( utm_campaign ) detail += "UTM Campaign: " + utm_campaign + "\n";
			if ( utm_source ) detail += "UTM Source: " + utm_source + "\n";
			if ( utm_medium ) detail += "UTM Medium: " + utm_medium + "\n";
			if ( utm_term ) detail += "UTM Term: " + utm_term + "\n";
			if ( utm_content ) detail += "UTM Content: " + utm_content + "\n";
			if ( search )
				detail += "Search: " + search + "\n";
			detail += "-----\n";
			detail += "Web Entry: " + loc + "\n";
			detail += "Referrer: " + referrer + "\n";
			createCookie( "sfgasrc"+aoAccountId, source, aoCookieTimeout, aoCookieDomain );
			createCookie( "sfgadetail"+aoAccountId, Base64.encode(detail), aoCookieTimeout, aoCookieDomain );
			if ( utm_campaign )	createCookie( "sfga_utmcmp"+aoAccountId, utm_campaign, aoCookieTimeout, aoCookieDomain );
			else				clearCookie(  "sfga_utmcmp"+aoAccountId, aoCookieDomain );
			if ( utm_source )	createCookie( "sfga_utmsrc"+aoAccountId, utm_source, aoCookieTimeout, aoCookieDomain );
			else				clearCookie(  "sfga_utmsrc"+aoAccountId, aoCookieDomain );
			if ( utm_medium )	createCookie( "sfga_utmmdm"+aoAccountId, utm_medium, aoCookieTimeout, aoCookieDomain );
			else				clearCookie(  "sfga_utmmdm"+aoAccountId, aoCookieDomain );
			if ( utm_term )		createCookie( "sfga_utmtrm"+aoAccountId, utm_term, aoCookieTimeout, aoCookieDomain );
			else				clearCookie(  "sfga_utmtrm"+aoAccountId, aoCookieDomain );
			if ( utm_content )	createCookie( "sfga_utmctn"+aoAccountId, utm_content, aoCookieTimeout, aoCookieDomain );
			else				clearCookie(  "sfga_utmctn"+aoAccountId, aoCookieDomain );
			}
		if ( !contains(seen,lDomain) )
			setSeenDomains([lDomain].concat(seen));
		}
	}());

