if (typeof jinja_location == 'undefined') { var jinja_location = {}; }


jinja_location.loading = function(opt_data, opt_sb, opt_caller) {
    var output = '';
    output += '\n<div id="loading">\n  <img src="' + opt_data.env.STATIC_URL + 'loading.gif" alt="loading"/>\n</div>\n';
    return output;
};

jinja_location.points_claimed = function(opt_data, opt_sb, opt_caller) {
    var output = '';
    output += '\n<i class="bonus-point-icon ' + opt_data.env.COMPANY_NAME + '-star-grey"></i>Point Claimed!\n';
    return output;
};

jinja_location.bonus_point_button = function(opt_data, opt_sb, opt_caller) {
    var output = '';
    output += '\n  ';
    if (opt_data.canClaim) {
        output += '\n    <div class="' + opt_data.view + '-button">\n      ';
        if (opt_data.claimed) {
            output += '\n        <button class="btn ' + opt_data.view + '-add-point add-point disabled" disabled data-uid="' + opt_data.business_group_uid + '">\n          ' + jinja_location.points_claimed({env: opt_data.env}) + '\n        </button>\n      ';
        } else {
            output += '\n        <button class="btn ' + opt_data.view + '-add-point add-point" data-uid="' + opt_data.business_group_uid + '">\n          <i class="bonus-point-icon ' + opt_data.env.COMPANY_NAME + '-star-color"></i>Claim a Point\n        </button>\n      ';
        }
        output += '\n    </div>\n  ';
    }
    output += '\n';
    return output;
};

jinja_location.bonus_point_banner = function(opt_data, opt_sb, opt_caller) {
    var defaults = {alertStyle: false};
    for (var key in defaults) {
        if (!(key in opt_data)) {
            opt_data[key] = defaults[key];
        }
    }
    var output = '';
    output += '\n';
    if (opt_data.alertStyle == false) {
        output += '\n  <i class="' + opt_data.env.COMPANY_NAME + '-banner-icon banner-icon"></i>\n  <div class="banner-text">\n    ';
        if (opt_data.loggedIn) {
            output += '\n      ';
            if (opt_data.bonusPoints <= 0) {
                output += '\n        Woohoo! You\'ve claimed all your bonus points.\n        <a href="/customer">See your memberships now.</a>\n      ';
            } else {
                if (opt_data.bonusPoints == 1) {
                    output += '\n        Claim your bonus point at any location. You have <span class="banner-highlight ">' + opt_data.bonusPoints + '</span> point left.\n      ';
                } else {
                    output += '\n        Claim your bonus points at any location. You have <span class="banner-highlight ">' + opt_data.bonusPoints + '</span> points left.\n      ';
                }
            }
            output += '\n    ';
        } else {
            output += '\n      Get bonus points towards free rewards by becoming a member.\n      <a id="register-user-link" href="#">Register Now!</a>\n    ';
        }
        output += '\n  </div>\n';
    } else {
        output += '\n  <div id="banner-icon"><i class="' + opt_data.env.COMPANY_NAME + '-banner-icon banner-icon"></i></div>\n  <div class="banner-text">\n    ';
        if (opt_data.loggedIn) {
            output += '\n      ';
            if (opt_data.bonusPoints <= 0) {
                output += '\n        Woohoo! You\'ve claimed all your bonus points.\n        <a href="/customer">See your memberships now.</a>\n      ';
            } else {
                if (opt_data.bonusPoints == 1) {
                    output += '\n        You have <span class="banner-highlight ">' + opt_data.bonusPoints + '</span> point to claim.\n      ';
                } else {
                    output += '\n        You have <span class="banner-highlight ">' + opt_data.bonusPoints + '</span> points to claim.\n      ';
                }
            }
            output += '\n    ';
        } else {
            output += '\n      Not a member? <a href="/accounts/register">Register for free points.</a>\n    ';
        }
        output += '\n  </div>\n  <a class="close" data-dismiss="alert" href="#">&times;</a>\n';
    }
    output += '\n';
    return output;
};

jinja_location.render_business = function(opt_data, opt_sb, opt_caller) {
    var output = '';
    output += '\n<div class="business" data-uid="' + opt_data.business.business_uid + '">\n  <div class="business-image">\n    <img src="' + opt_data.business.logo + '"></img>\n  </div>\n  <div class="business-info">\n    <div class="title">\n      <a href="' + opt_data.business.url + '" target="_blank">' + opt_data.business.name + '</a>\n    </div>\n    <div class="address">\n      ' + opt_data.business.address_line1 + '\n    </div>\n    <div class="reward">\n      <img src="' + opt_data.env.STATIC_URL + 'images/reward-star.png">\n      ' + opt_data.business.rewards[0].perk + '\n    </div>\n    ' + jinja_location.bonus_point_button({env: opt_data.env, view: 'result', business_group_uid: opt_data.business.business_group_uid, canClaim: opt_data.canClaim, claimed: opt_data.claimed}) + '\n  </div>\n  <div class="business-extra">\n    ';
    if (opt_data.business.distance) {
        output += '\n      <div>\n        ';
        if (opt_data.business.distance != 1) {
            output += '\n          ' + opt_data.business.distance + ' ' + opt_data.business.distance_type + 's\n            ';
        } else {
            output += '\n          ' + opt_data.business.distance + ' ' + opt_data.business.distance_type + '\n        ';
        }
        output += '\n      </div>\n    ';
    }
    output += '\n  </div>\n  <div class="clear"></div>\n</div>\n';
    return output;
};

jinja_location.render_city = function(opt_data, opt_sb, opt_caller) {
