var countdown = function (d, h, m, s) {
    var interval = setInterval(go, 1000);

    function go() {
        if (!update()) {
            stop();
        }
    }

    function stop() {
        clearInterval( interval);
    }


    function update() {
        d_string = d; h_string = h; m_string = m; s_string = s;

        if(h < 10)
            h_string = '0' + h;
        if(m < 10)
            m_string = '0' + m;
        if(s < 10)
            s_string = '0' + s;
        if(d == 0) {
            d_string = "";
        }
        else {
            d_string = d + ' days ';
        }


        $('#countdown_timer').html(d_string + h_string + ':' + m_string + ':' + s_string);
        if(s == 0) {
            if(m == 0) {
                if(h == 0) {
                    if(d == 0) {
                        $('#countdown_timer').html("This promotion has expired.");
                        return false;
                    }
                    else {
                        d -= 1;
                        h = 23;
                        m = 59;
                        s = 59;
                    }
                }
                else {
