var filterRows = function(rowClassName) {
  $(rowClassName).hide();
  if( $(".filter_box:checked").length == 0 ) {
    $(rowClassName).show();
    return;
  }

  filters = {}
  $(".filter_box:checked").each( function(i) {
    var column = $(this).attr("column");
    var filterval = $(this).attr("filterval");
    if(column in filters) {
      filters[column].push(filterval);
    }
    else {
      filters[column] = [filterval];
    }
  });
  rows = $(rowClassName);
  for (column in filters) {
    var candidates = $([]);
    for(i=0; i<filters[column].length; i++) {
      filterval = filters[column][i];
      if( column.indexOf("__int") > -1 ) {
        var filterType = "int";
        var bounds = filterval.split('-');
        var lowerbound = parseInt(bounds[0]);
        var upperbound = bounds[1];
        if( upperbound == "inf" ) {
          upperbound = Infinity;
        }
       else {
          upperbound = parseInt(upperbound);
        }
      }
      else if ( column.indexOf("__date") > -1 ) {
        filterType = "date";
        var last_x_days = parseInt(filterval);
        var today = new Date();
      }
      else {
        filterType = "equate";
      }

      candidates = candidates.add(rows.filter( function() {
        if( filterType == "int" ) {
          var td_filterval = parseInt($(this).children("td[column='" + column + "']").attr("filterval"));
          return ( td_filterval >= lowerbound && td_filterval <= upperbound ) ? true : false;
        }
        else if ( filterType == "date" ) {
          var td_filterval = $(this).children("td[column='" + column + "']").attr("filterval").split('/');
          var d = new Date(td_filterval[2], td_filterval[0]-1, td_filterval[1]);
          var delta_days = (today - d)/1000/60/60/24;
          return ( delta_days <= last_x_days ) ? true : false;

        }
        else {
          td_filterval = $(this).children("td[column='" + column + "']").attr("filterval");
          return ( td_filterval == filterval ) ? true : false;
        }
      }));
    }
    rows = candidates;
  }
  rows.show();
}



fs.phonemask = function(jqueryObj) {
  jqueryObj.keyup(function() {
    $(this).val( $(this).val().replace('(', '').replace(')', '') );
    if( $(this).val().length == 4 ) {
       var phone = parseInt( $(this).val() );
       if( isNaN(phone) ) {
         phone = parseInt( $(this).val().slice(1) );
       }
       if( phone > 999 ) {
         $(this).val( phone.toString().slice(0, 3) + "-" + phone.toString().slice(3) );
       }
       else if( phone > 99 && phone < 1000) {
         $(this).val(phone + "-");
       }
    }
    if( $(this).val().length == 8 ) {
       var phone = parseInt( $(this).val().replace('-', '') );
       if( phone > 999999 ) {
         $(this).val( phone.toString().slice(0, 3) + "-" + phone.toString().slice(3, 6) + "-" + phone.toString().slice(6) );
       }
       else if( phone > 99999 && phone < 999999 ) {
         $(this).val( phone.toString().slice(0, 3) + "-" + phone.toString().slice(3, 6) + "-" );
       }
    }
  });
}

