$(document).ready(function() {
    var modal_opts = {show: true, backdrop: true, keyboard: true};
    $(".contact_us").click(function() {
        $("#contact_form").modal(modal_opts);
    });

    // size video on load. should probably do this when window is sized too!
    video = $("#the_video");
    height = video.width() * 9 / 16;
    video.height(height);

    mixpanel.track("Business page loaded");

    mixpanel.track_forms("business_lead_form_1", "Business Page Form Submit #1 Clicked");
    mixpanel.track_forms("business_lead_form_2", "Business Page Form Submit #2 Clicked");

    /*
     * Validators
     */

    var first_name_check = function(first_name) {
      // checks if there is a first name
      return first_name ? true : false;
    };

    var last_name_check = function(last_name) {
      // checks if there is a last name
      return last_name ? true : false;
    };

    var phone_check = function(phone) {
      if (!phone) return false;
      // checks if a phone number is valid
      return phone.length < 12 ? false : true;
    };

    /*
     * Views for DOM Manipulation
     */

    // Generic view for updating field messages
    var update_field = function(isValid, element, message) {
      if (!isValid) {
        element.next().text(message);
        element.parents(".control-group").removeClass("success").addClass("error");
      } else {
        element.next().text("");
        element.parents(".control-group").removeClass("error").addClass("success");
      }
    };

    var update_first_name = function() {
      var element = $("#id_first_name");
      var isValid = first_name_check(element.val());
      update_field(isValid, element, "First name is required.");
    };

    var update_last_name = function() {
      var element = $("#id_last_name");
      var isValid = last_name_check(element.val());
      update_field(isValid, element, "Last name is required.");
    };

    var update_phone = function() {
      var element = $("#id_phone");
      var isValid = phone_check(element.val());
      update_field(isValid, element, "Must have 10 digits.");
    };

    /*
     * Event Hooks
     */

    fs.phonemask($("#id_phone"));

    // Check that all required fields are filled before submission
    $("#business_lead_form_2").submit(function() {
      var phoneIsValid = phone_check($("#id_phone").val());
      var firstNameIsValid = first_name_check($("#id_first_name").val());
      var lastNameIsValid = last_name_check($("#id_last_name").val());
      var formIsValid = phoneIsValid && firstNameIsValid && lastNameIsValid;
      if (!formIsValid) {
        $("#submission_errors").removeClass("hide").text("Please fill in all required fields.");
        return false;
      }
      return true;
    });

    // Each of these reruns a view when field is modified

    $("#id_first_name").blur(function() {
      update_first_name();
    });

    $("#id_last_name").blur( function() {
      update_last_name();
    });

    $("#id_phone").blur( function() {
      update_phone();
    });

});

